Yesterday was amazing. Such a great experience to perform and meeting so many lovely people!
Thank so much to the @tictacartcentre for having us and hope to be back soon!
@limenproject will be back soon with more dates and infos!

I feel like Sasha (my Ukulele) hasn't been in my feed for a while now so I think it deserves a moment. It's also here to tell you that after all this year of hype from me about #StArt I can finally say that IT'S  OUT Y'ALL! #StArt, my own short art film is out! IT'S NOT A DRILL,FOLKS.
Jokes aside, it might not be that much but it's a project that meant a lot for me and I am really happy so many artist have been involved and that the performance could be parto of the Dance Trail 2019. So I want to thank everybody for their talent and their patience for me:
@sasizzaoceane for being a great soul and dancer
@la.maryposa for being the greatest queen around, guuuurl
@ruggerofornari for his incredible music and soul
@seri.emilio for his help and patience about editing and for his great talent
@freaky_paul for his great artistry
@riccluc and @yxor_3 for their genius and minds
And last but not least @surrealistboss for her great talent and time
LINK IN BIO TO WATCH 
#StArt #spreadingtheart #dancing #performance #shortfilm
